          path: cc11001100_hook("path", "data/tools/make", "object-key-init"),
          install: cc11001100_hook("install", "Installed already on *most* Unix systems. Available from [gow](https://github.com/bmatzelle/gow) on Windows.\n", "object-key-init"),
          usage: cc11001100_hook("usage", '```make\nSRC = $(wildcard src/*.js)\nLIB = $(SRC:src/%.js=lib/%.js)\n\nlib: $(LIB)\nlib/%.js: src/%.js babel.config.json\n  mkdir -p $(@D)\n  babel $< -o $@\n```\n\n```sh title="Shell"\nmake\n```\n', "object-key-init")
