          install: cc11001100_hook("install", '```rb\n# Gemfile\ngem "sprockets"\ngem "sprockets-bumble_d"\n```\n\n```sh title="Shell"\nbundle install\nnpm install --save @babel/core @babel/plugin-external-helpers @babel/plugin-transform-modules-umd @babel/preset-env\n```\n', "object-key-init"),
